// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.7.0 <0.9.0;

// state variables

contract Lottery {
    address[] participant;
    address payable public winner;
    address public lotteryManager;
    address payable lotterAccount;

    uint256 number;

    //modifier

    //set lottery Account
    function _1setLotteryAccount() public {
        lotterAccount = payable(msg.sender);
    }

      //set manager  Account
    function _2setManagerAccount() public {
        lotterAccount = payable(msg.sender);
    }

    //participate
    function _3participate() public returns(address participated ) {

        participant.push(msg.sender);
        return msg.sender;
    }

    //pay lotteryFee
    function _4payLotteryFee(uint) public payable {
         require(_3participate()==msg.sender);
          lotterAccount.transfer(msg.value);
    }


    //get lottery account balance
    function _5getBalance() public view returns (uint) {
        require(msg.sender == lotteryManager);
        return address(lotterAccount).balance;
    }

    //get random winner
    function _6getRandomWinner() public payable {
        require(msg.sender == lotteryManager);
        bytes32 rand = blockhash(block.number - 1);
        bytes32 rand2 = blockhash(block.number - 2);
        bytes32 rand3 = blockhash(block.number - 3);

        uint256 randomNumber = uint256(
            keccak256(abi.encodePacked(rand, rand2, rand3))
        );
        number = randomNumber % participant.length;
        winner = payable(participant[number]);
        winner.transfer(_5getBalance());
        participant = new address payable[](0);
    }

    //get winner balance
    function _7getWinnerBalance() public view returns (uint256) {
        require(msg.sender == participant[number]);
        return msg.sender.balance;
    }
}

